import React from 'react'
import Card from './Card'
import {useSelector} from 'react-redux'

function Cards() {
    const recipe = useSelector(state => state.recipe)//TRAETE DEL ESTADO EL RECIPE

    //Recibo Page, muestro los elementos con indice mayores a inf y menores a sup
    const Page = 1;
    let inf = 9*Page - 8
    let sup = 9*Page

    return (
        <div>
           {
                recipe.length>0 ? 
                <div>
                    { recipe.map((e,) => {
                        if (e.i > inf && e.i< sup)
                        return (<Card 
                        key={e.id}
                        img={e.image}
                        title={e.title}
                        />)
                    }

                    )}
                </div>
                :
                <h1>Cargando...</h1>
           }
        </div>
    )
}

export default Cards

